import React, {Component} from 'react';
import Item_github from "../Item_github";

class List extends Component {

    render() {
        const {users, isfirst, is_login,err}=this.props
        return (
            <div>
                <div className="row">
                    {
                        users.map((user)=>{
                            return <Item_github key={user.id} user={user}/>
                        })
                    }
                    {/*{*/}
